import React, { component } from 'react';
import data from "./data/countries.json";

const Countries = data.map((data) => {
    return (
        <Card key={data.code}>
            <Card.Body>
                <Card.Title>{data.name}</Card.Title>
            </Card.Body>

        </Card>
    )
}
);

export default Countries;
